# Validation
class Validator:
    def validate_flex_fields(self, fields: Dict) -> bool:
        # Example: Validate flex fields don't exceed limits
        total_size = sum(len(str(v)) for v in fields.values())
        return total_size < 1000  # Arbitrary size limit

    def validate_duns_number(self, duns: str) -> bool:
        # Example: Basic DUNS validation
        return bool(re.fullmatch(r'^\d{9}$', duns))

