        return self._publish_enabled

    def disable_publish(self):
        self._publish_enabled = False
        print("Publish button disabled")

    def enable_publish(self):
        self._publish_enabled = True
        print("Publish button enabled")

# Business Logic
class BusinessLogic:
    @staticmethod
    def derive_funding_agency_code(record: Dict) -> str:
        # Example: Derive agency code from other fields
        return record.get("agency", "UNKNOWN")[:3].upper()

    @staticmethod
    def is_gtas_lockdown_active() -> bool:
        # Example: Check if current time is within GTAS window
        now = datetime.now().time()
        start = datetime.strptime("18:00", "%H:%M").time()
        end = datetime.strptime("06:00", "%H:%M").time()
        return start <= now or now <= end

